import React from 'react';
import './Software2023.css';

const Software2023 = () => {
  return (
    <div className='software2023'>
        <div className='content'>
            <h1>2023 Summer Software Workshop</h1>
            <p>In this workshop, we reviewed APS105 and introduced some concepts from ECE244 and ECE297</p>
            <div className='listContainer'>
              <ul>
                <li></li>
              </ul>
            </div>
        </div>
    </div>
  )
}

export default Software2023
